  <style>
    * {
      box-sizing: border-box;
      overflow: hidden;
    }

    body {
      margin: 0;
      font-family: Arial;
      font-size: 17px;
    }

    .content {
      position: fixed;
      bottom: 0;
      background: rgba(0, 0, 0, 0.5);
      color: #f1f1f1;
      width: 100%;
      padding: 20px;
    }

    .allscreen {
      position: absolute;
      top: 0;
      right: 0;
      bottom: 0;
      left: 0;
      height: 100%;
      width: 100%;
    }

    #allscreenBtn {
      width: 100%;
      height: 100%;
      font-size: 18px;
      padding: 10px;
      border: none;
      background: rgba(0, 0, 0, 0);
      color: rgba(0, 0, 0, 0);
      cursor: pointer;
    }

    #container {
      position: relative;
      width: 100vh;
      height: 100vh;
    }

    #loopVideo {
      position: absolute;
      left: 0%;
      top: 0%;
      width: 100%;
      height: 100%;
    }

    #TutorHand {
      position: absolute;
      opacity: 0;
      width: 10%;
    }

    #CtaLogo {
      position: absolute;
      width: 12%;
      bottom: 2%;
      left: 3%;
    }

    #CtaDownload {
      position: absolute;
      width: 12%;
      bottom: 2%;
      right: 3%;
    }

    #LoadingBack {
      position: absolute;
      top: 0;
      right: 0;
      bottom: 0;
      left: 0;
      height: 100%;
      min-width: 100%;
      z-index: 100;
    }

    #LoadingLogo {
      position: fixed;
      width: 30%;
      bottom: 45%;
      left: 35%;
      z-index: 101;
    }

  </style>
